import {createSlice} from "@reduxjs/toolkit";

const initialState = {
    token: localStorage.getItem("token"),//check local storage for token, buitl in JS object
    name: "",
    email: "",
    _id: "",
    registerStatus: "",//pending, fullfilled, or reject
    registerError: ""
}

const authSlice = createSlice(
    {
        name: "auth",
        initialState
    }//accepting object
)
